{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/faymutio/bellabeat-case-study?scriptVersionId=216076779\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"09f9e843","metadata":{"_cell_guid":"1b54cd3a-d0ea-4be5-b072-7075f1c8ee74","_uuid":"3816b636-6c03-4edc-aed9-b335442e3076","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.012086,"end_time":"2025-01-04T13:23:42.27958","exception":false,"start_time":"2025-01-04T13:23:42.267494","status":"completed"},"tags":[]},"source":["# CASE STUDY: BELLABEAT"]},{"cell_type":"markdown","id":"6bffd6de","metadata":{"_cell_guid":"579b96f0-e7fd-4e2f-9809-0878e8072b4d","_uuid":"2b1d87db-2e0d-49ba-80f0-37a9504ac825","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.010373,"end_time":"2025-01-04T13:23:42.301046","exception":false,"start_time":"2025-01-04T13:23:42.290673","status":"completed"},"tags":[]},"source":["## Table of Contents \n","\n","1. Introduction\n","2. Ask Phase\n","3. Prepare Phase\n","4. Process Phase\n","5. Analyze Phase\n","6. Share Phase\n","7. Act Phase"]},{"cell_type":"markdown","id":"a0876c77","metadata":{"_cell_guid":"f2d82c44-f551-4a42-bdef-e399b7aaf678","_uuid":"fb5fbbe4-af0a-4956-90cd-5e5388ce1822","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.0103,"end_time":"2025-01-04T13:23:42.321585","exception":false,"start_time":"2025-01-04T13:23:42.311285","status":"completed"},"tags":[]},"source":["# 1. Introduction\n","Bellabeat is a wellness-focused tech company that creates beautifully designed smart devices and apps to empower women with insights into their health and habits. The company was founded in 2013 by Urška Sršen and Sando Mur. The Bellabeat app connects with users' smart wellness products to provide users with data on activity, sleep, stress, menstrual cycles, and mindfulness habits, helping them make informed health decisions. By 2016, Bellabeat had expanded globally, offering products through its website and online retailers. The company emphasizes digital marketing through Google Search, social media, YouTube, and the Google Display Network, complemented by traditional advertising such as radio and print, to drive brand awareness and growth."]},{"cell_type":"markdown","id":"1acc9c3a","metadata":{"_cell_guid":"cf97b7b6-2ad7-45e4-acce-62d81019218f","_uuid":"9b4dbd58-a0c3-4688-b04b-99aa450e7c69","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.010225,"end_time":"2025-01-04T13:23:42.342741","exception":false,"start_time":"2025-01-04T13:23:42.332516","status":"completed"},"tags":[]},"source":["# 2. Ask Phase\n","## Business Task\n","How can Bellabeat use smart device insights to improve its marketing strategy?\n","## Objective\n","This project will focus on analyzing data from the Bellabeat app to uncover insights into user habits and preferences. These insights will inform high-level recommendations to optimize Bellabeat's marketing strategy and drive engagement.\n","## Key Stakeholders\n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer.\n","* Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team."]},{"cell_type":"markdown","id":"d9d0670d","metadata":{"_cell_guid":"7fa62920-31e8-4528-8e38-fd603a32fdab","_uuid":"69c09c94-2f09-4db2-b7d9-68b2e058d1d1","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.010142,"end_time":"2025-01-04T13:23:42.3632","exception":false,"start_time":"2025-01-04T13:23:42.353058","status":"completed"},"tags":[]},"source":["# 3. Prepare Phase\n","## About the Data\n","This project will make use of the FitBit Fitness Tracker Data, which is a public domain dataset made available through Mobius. This Kaggle dataset contains personal fitness tracker data from thirty FitBit users. This means that thirty eligible users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and calories that can be used to explore user habits.\n","## Licensing and Privacy of Data\n","The dataset does not include personally identifiable information (PII), as it contains aggregated fitness data like activity, heart rate, and sleep patterns. This ensures the privacy of the individuals who provided the data. Furthermore, ethical standards in data analysis have been emphasized by respecting the original intent of the data collection and focusing on aggregated insights rather than individual-level analysis. Lastly, even though the data is anonymized, secure data storage and handling practices have been implemented to prevent unauthorized access or misuse.\n","## Verification of Data Integrity\n","The dataset originates from Mobius on Kaggle, a trusted platform, with proper documentation and licensing. Data quality checks are performed to ensure completeness, consistency, and accuracy by identifying missing values, outliers, and logical inconsistencies, and summary statistics are cross-referenced with publicly available benchmarks for validation. Additionally, metadata is reviewed to confirm collection methods, participant details, and alignment with the dataset’s stated purpose. Ethical considerations are also addressed by confirming anonymization, proper participant consent, and adherence to privacy standards, ensuring the dataset is reliable and suitable for analysis."]},{"cell_type":"markdown","id":"9691f044","metadata":{"_cell_guid":"0a5cc935-8e96-48f5-a46c-bbb36a4fa4bd","_uuid":"aa2440f6-b0ec-44de-8f4b-2dd87e87b0cb","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.010257,"end_time":"2025-01-04T13:23:42.383759","exception":false,"start_time":"2025-01-04T13:23:42.373502","status":"completed"},"t