, daily_steps, \n","                               by.x = c(\"id\", \"activity_date\"), \n","                               by.y = c(\"id\", \"activity_day\"), \n","                               all = TRUE)"]},{"cell_type":"markdown","id":"4d9c4360","metadata":{"_cell_guid":"5a0b2107-633c-4503-a4e3-5b45750a2702","_uuid":"613689c8-cd21-4844-ad30-5cb0f7483275","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.012994,"end_time":"2025-01-04T13:23:44.91859","exception":false,"start_time":"2025-01-04T13:23:44.905596","status":"completed"},"tags":[]},"source":["Next, the resulting merged dataset is combined with the `daily_sleep` dataset using the `id` and date columns (`activity_date` and `sleep_day`). This step integrates all three datasets into a unified table for analysis."]},{"cell_type":"code","execution_count":17,"id":"5fc0c3a5","metadata":{"_cell_guid":"09e7e53a-fee3-46d5-a3e0-3b3883dac03f","_uuid":"5064621e-e612-4d21-8c12-ced64ed19a83","collapsed":false,"execution":{"iopub.execute_input":"2025-01-04T13:23:44.949415Z","iopub.status.busy":"2025-01-04T13:23:44.947955Z","iopub.status.idle":"2025-01-04T13:23:44.970388Z","shell.execute_reply":"2025-01-04T13:23:44.968383Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.040145,"end_time":"2025-01-04T13:23:44.972872","exception":false,"start_time":"2025-01-04T13:23:44.932727","status":"completed"},"tags":[]},"outputs":[],"source":["#Merging the merged datasets above to daily_sleep dataset\n","merged_data<-merge(activity_steps_merged,daily_sleep,\n","                         by.x=c(\"id\",\"activity_date\"),\n","                         by.y=c(\"id\",\"sleep_day\"),\n","                         all=TRUE)"]},{"cell_type":"markdown","id":"6968807c","metadata":{"_cell_guid":"107c66eb-4bb5-4f59-bccf-f147ffde8266","_uuid":"3047fd6a-2fdc-4b5a-9349-8155cfd4e927","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.013341,"end_time":"2025-01-04T13:23:44.99911","