 = c(\"Sedentary\" = \"red\", \"Lightly Active\" = \"orange\", \"Fairly Active\" = \"blue\", \"Very Active\" = \"purple\"))"]},{"cell_type":"markdown","id":"565df641","metadata":{"_cell_guid":"f57ff622-ecee-4eea-a4e7-13ed9117bc0b","_uuid":"5b066c2a-2a6b-45b4-8efc-f786a245896b","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.018216,"end_time":"2025-01-04T13:23:46.594035","exception":false,"start_time":"2025-01-04T13:23:46.575819","status":"completed"},"tags":[]},"source":["### Key Observations:\n","1. **Positive Correlation**: There is a clear positive relationship between distance traveled and calories burned. As users cover more distance, they tend to burn more calories.\n","   \n","2. **Step Categories**:\n","   - **Sedentary** (red): These users generally show the lowest distances traveled and calories burned, clustered toward the bottom-left.\n","   - **Lightly Active** (yellow): These points show a moderate increase in both distance and calorie burn compared to sedentary users.\n","   - **Fairly Active** (blue): Users in this category display a higher range of distance and calorie burn, indicating increased activity levels.\n","   - **Very Active** (purple): These users cover the highest distances and burn the most calories, with points extending farthest along both axes.\n","\n","3. **Spread Within Categories**: Each step category shows some spread in calorie burn for similar distances, likely influenced by factors like body weight, age, and exercise intensity.\n","\n","### Insights:\n","- The plot emphasizes the role of physical activity in increasing calorie expenditure.\n","- Encouraging users to move from lower activity categories (e.g., Sedentary) to higher ones (e.g., Fairly or Very Active) can lead to substantial improvements in calories burned and overall fitness.\n","- Additional factors (e.g., pace, incline) might explain variations in calorie burn for similar distances within a step category."]},{"cell_type":"markdown","id":"8c06d7e5","metadata":{"_cell_guid":"9eb6f0f8-4b7e-4ac0-85a1-396c459bb61b","_uuid":"2d4c1ccd-5630-47b0-8467-c17c87388821","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.017769,"end_time":"2025-01-04T13:23:46.629539","exception":false,"start_time":"2025-01-04T13:23:46.61177","status":"completed"},"tags":[]},"source":["### Calories Burned vs Active Minutes\n","This comprises the average and total number of calories burned by each user. We correlate calorie burn with active minutes to better understand user participation in physical activities."]},{"cell_type":"code","execution_count":23,"id":"f2ea4113","metadata":{"_cell_guid":"1a52e4d7-2827-408f-be37-57efab55da46","_uuid":"7c3979d3-cfc1-4d2f-8d5d-317879fef065","collapsed":false,"execution":{"iopub.execute_input":"2025-01-04T13:23:46.669807Z","iopub.status.busy":"2025-01-04T13:23:46.668209Z","iopub.status.idle":"2025-01-04T13:23:46.710071Z","shell.execute_reply":"2025-01-04T13:23:46.708124Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.064262,"end_time":"2025-01-04T13:23:46.712446","exception":false,"start_time":"2025-01-04T13:23:46.648184","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\u001b[90m# A tibble: 4 × 3\u001b[39m\n","  StepCategory   AvgCaloriesBurned AvgActiveMinutes\n","  \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m                      \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m            \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m\n","\u001b[90m1\u001b[39m Fairly Active              \u001b[4m2\u001b[24m461.            292. \n","\u001b[90m2\u001b[39m Lightly Active             \u001b[4m2\u001b[24m254.            252. \n","\u001b[90m3\u001b[39m Sedentary                  \u001b[4m1\u001b[24m807.             92.5\n","\u001b[90m4\u001b[39m Very Active                \u001b[4m2\u001b[24m744.            314. \n"]}],"source":["#Add StepCategory as temporary column to dataset\n","step_categories <- merged_data %>%\n","  mutate(StepCategory = case_when(\n","    total_steps >= 10000 ~ \"Very Active\",\n","    total_steps >= 7500 ~ \"Fairly Active\",\n","    total_steps >= 5000 ~ \"Lightly Active\",\n","    TRUE ~ \"Sedentary\"\n","  )) \n","#Calculate Average Calories and Active Minutes per Step Category\n","summary_stats <-step_categories %>%\n","  group_by(StepCategory) %>%\n","  summarize(\n","    AvgCaloriesBurned = mean(calories, na.rm = TRUE),\n","    AvgActiveMinutes = mean(very_active_minutes + fairly_active_minutes + lightly_active_minutes, na.rm = TRUE)\n","  )\n","\n","print(summary_stats)"]},{"cell_type":"code","execution_count":24,"id":"cedd1b30","metadata":{"_cell_guid":"87ca96c5-8b39-4ec2-b8a7-03fcf2417db1","_uuid":"cbe42232-9b45-4055-81d9-177a7e38eee8","collapsed":false,"execution":{"iopub.execute_input":"2025-01-04T13:23:46.752022Z","iopub.status.busy":"2025-01-04T13:23:46.750424Z","iopub.status.idle":"2025-01-04T13:23:47.061326Z","shell.execute_reply":"2025-01-04T13:23:47.059463Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.333306,"end_time":"2025-01-04T13:23:47.063601","exception":false,"start_time":"2025-01-04T13:23:46.730295","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT9RvH8eeStOnepZS9yt5T9kaWiAgCosgQ5AfIXoooAm7ZIKCoiIqAC0RR\n2aiAyFbLkL1XKZTuNsn9/kgp3VxHKD3er7+a763nm7tLPr0VRVVVAQAAQMFnyO8CAAAAkDcI\ndgAAADpBsAMAANAJgh0AAIBOEOwAAAB0gmAHAACgEwQ7AAAAnSDYAQAA6MTDFexUW3R5N2dF\nUQxG571RifldTr5RrZFrPpjWo90jxQsHuDo5e/sVqtXk0UmzvghLtGV3Vn+/U09RlNZrz+S+\nqn0v1VQUpcP2S7mfVdYiz7+hpGMwmv0KlWrd7YXvD4Q5uoA8NLusr6Io62/GZTbCi0U9FUU5\nGmtxUAHWuHMfvzWmbaPqgb5eTiZnL/8idVp0mTJ/dYT1gXjyeR5u6gBQIJjyu4D76sY/k47H\nJoqIakuc8N2ZLX1D8ruifBB9ccsTTbpuPBMpImZP/8JFg25dvXxwx4aDOzZ8MH/ZL3t/bOTv\nkt813g8Go3uZ0sHJLy3x0Zcuntvy/Yfbfvjy1fXHXmtXNB9rKyiizv3Usm6PvddjFYNz4RKl\n61Twun3t3IHffty/fd38+V9s3PtNPS9n+5iqLXrnroMmc4kGdYvft/LydlPPly4AQLapD5Ov\n2xQTkSIdy4iId6mX8