NwIhhHY8OHkCIYQQQqhMYI8dQgiNpJNOOSX8pYrxbgVCaAeFY+wQQgghhMoEXopFCCGEECoT\nGOwQQgghhMoEBjuEEEIIoTKBwQ4hhBBCqExgsEMIIYQQKhMY7BBCCCGEygQGO4QQQgihMoHB\nDiGEEEKoTGCwQwghhBAqE/8ffBL2X/7Fj1IAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["#Density plot with smooth line for each StepCategory\n","ggplot(step_categories, aes(x = total_minutes_asleep, y = total_steps, color = StepCategory)) +\n","  geom_point(alpha = 0.6) +  # Scatter points\n","  geom_smooth(method = \"lm\", se = FALSE, aes(group = StepCategory)) +\n","  labs(title = \"Steps vs Sleep by Step Category\",\n","       x = \"Total Minutes Asleep\",\n","       y = \"Total Steps\") +\n","  theme_minimal() +\n","  theme(legend.title = element_blank())"]},{"cell_type":"markdown","id":"79f72136","metadata":{"_cell_guid":"1acdda49-45b4-449f-9444-4eaa579d9e1c","_uuid":"68e2f00e-8fd5-481b-80c6-3a5110d67be5","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.023795,"end_time":"2025-01-04T13:23:49.611762","exception":false,"start_time":"2025-01-04T13:23:49.587967","status":"completed"},"tags":[]},"source":["### Key Observations:\n","1. **General Trend**:\n","   - There doesn't appear to be a strong correlation between the number of steps and total minutes asleep. This suggests that the amount of sleep a user gets may not directly impact their daily step count.\n","\n","2. **Activity Levels**:\n","   - **Sedentary** users tend to have fewer total steps overall, as expected, and their sleep durations are distributed across a wide range.\n","   - **Lightly Active**, **Fairly Active**, and **Very Active** users show progressively higher step counts. However, their sleep durations are also spread across various levels, indicating no clear pattern connecting higher activity levels with more or less sleep.\n","\n","3. **Category Differentiation**:\n","   - The colors show distinct step ranges for each category, aligning with how step categories were defined (e.g., Very Active users exceeding 10,000 steps daily).\n","\n","This chart highlights that while activity levels (steps) are distinct among categories, sleep duration remains relatively independent of activity level. This insight can guide Bellabeat to focus on personalizing marketing strategies for activity-based goals rather than sleep patterns alone."]},{"cell_type":"markdown","id":"5305e8fb","metadata":{"_cell_guid":"d64dac66-b376-4c77-bba0-473dbd589499","_uuid":"5b757e9c-b269-4ec2-b9c1-cad9b5f4bf78","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.024051,"end_time":"2025-01-04T13:23:49.659717","exception":false,"start_time":"2025-01-04T13:23:49.635666","status":"completed"},"tags":[]},"source":["# 5. Act Phase\n","Our goal is to determine how marketing strategies can be enhanced by smart device insights, specifically from the Bellabeat app. Further research with larger datasets is encouraged, as our sample size was small and did not account for factors such as geographical location."]},{"cell_type":"markdown","id":"2c0be6a0","metadata":{"_cell_guid":"e256582f-d57f-432c-8178-b3cf32d4facc","_uuid":"24c3edd0-06c4-4562-a055-a111928d8d58","collapsed":false,"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.023682,"end_time":"2025-01-04T13:23:49.706953","exception":false,"start_time":"2025-01-04T13:23:49.683271","status":"completed"},"tags":[]},"source":["### Recommendations to Optimize Bellabeat’s Marketing Strategy and Drive Engagement  \n","\n","#### **1. Sleep Duration**  \n","- **Trend Utilization:** Integrate wearable device sleep tracking with actionable insights, leveraging the popularity of personalized health recommendations.  \n","- **App Enhancements:**  \n","  - Add a feature to detect sleep irregularities and provide customized suggestions like mindfulness exercises or stress-reduction activities.  \n","  - Develop a \"Sleep Coach\" tool that uses AI to predict and recommend optimal bedtime routines.  \n","- **Marketing Strategy:**  \n","  - Promote Bellabeat’s ability to improve sleep hygiene through targeted campaigns emphasizing its smart device integration and data-backed solutions.  \n","\n","#### **2. Distance vs. Calorie Burn**  \n","- **Trend Utilization:** Highlight fitness motivation trends by motivating users to increase activity levels.  \n","- **App Enhancements:**  \n","  - Incorporate progress tracking challenges (e.g., step milestones or distance goals) with badges and rewards.  \n","  - Include personalized calorie-burn goals based on user fitness levels and activity history.  \n","- **Marketing Strategy:**  \n","  - Position Bellabeat app as a fitness companion with real-time tracking and motivational features. Use testimonials and success stories in campaigns.  \n","\n","#### **3. Calorie Burned vs. Active Minutes**  \n","- **Trend Utilization:** Capitalize on the demand for real-time feedback and AI-driven fitness predictions.  \n","- **App Enhancements:**  \n","  - Develop predictive calorie-burn analytics using AI to help users plan workouts effectively.  \n","  - Add visual data comparisons showing how increased activity impacts calorie burn over time.  \n","- **Marketing Strategy:**  \n","  - Use interactive advertisements showcasing the app’s ability to track, analyze, and predict calorie burn to appeal to fitness enthusiasts and weight management audiences.  \n","\n","#### **4. Activity and Sleep Insights**  \n","- **Trend Utilization:** Leverage data-driven personalization to appeal to users looking for integrated health insights.  \n","- **App Enhancements:**  \n","  - Introduce comparative dashboards that link sleep quality and activity levels to stress and wellness.  \n","  - Provide weekly summaries showing correlations between user habits (activity, sleep, stress).  \n","- **Marketing Strategy:**  \n","  - Segment users into activity-focused and sleep-focused groups for personalized campaigns. Highlight the app’s ability to provide holistic health insights.  \n","\n","#### **5. Mindfulness and Stress Management**  \n","- **Trend Utilization:** Tap into the growing mindfulness movement and rising demand for stress management tools.  \n","- **App Enhancements:**  \n","  - Add guided meditation sessions or breathing exercises based on real-time stress detection.  \n","  - Integrate mood-tracking features linked to activity and sleep data to personalize wellness tips.  \n","- **Marketing Strategy:**  \n","  - Create campaigns focusing on the app's unique integration of stress detection, mindfulness, and health tracking tools. Highlight the app’s proactive stress-reduction features.  \n","\n","#### **6. Emerging Trends in Smart Device Usage**  \n","- **Focus Areas:**  \n","  - **Wearable Compatibility:** Ensure compatibility with emerging wearable devices, such as smart rings and glasses, to expand user reach.  \n","  - **Sustainability Focus:** Develop eco-friendly wearable devices and market them as part of Bellabeat’s commitment to wellness and sustainability.  \n","  - **Social Connectivity:** Incorporate social sharing features for fitness milestones and mindfulness habits to boost app visibility through user engagement.  \n","\n","These recommendations aim to improve Bellabeat app's functionality, increase marketing effectiveness, and drive user engagement and satisfaction by aligning its features with emerging smart device usage trends and leveraging insights from user behavior data."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":7746251,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":10.62795